import React from 'react';
import { Route, Routes} from 'react-router-dom';
import AddUser from './NewUserForm';
import Home from './Home';
import Instrucion from './Instruction';
import Succsess from './Completion';
import { UserApi } from './UserApi';
import Completion from './Completion';

export default function MyRouter() {

    return (
        <div>
            <Home/>
            <Routes>
                  {/* <Route path='/' element={<Home />} />   */}
                <Route path='/user' element={<AddUser />} />
                <Route path='/instruction' element={<Instrucion />} />
                <Route path='/userAPI' element={<UserApi />} />
                <Route path='/excel' element={<Completion />} />
            </Routes>
        </div>
    );
}
